import React from "react";
import "./styles.scss";
import strings from "../../en-NZ";
import ContentBlock from "../../components/ContentBlock/ContentBlock";
import cn from "classnames";

const content = [
  strings.about.iam,
  strings.about.recent,
  strings.about.self,
  strings.about.check,
];

const graphValues = [
  { label: "HTML", width: "50", colour: "shade-0" },
  { label: "CSS", width: "50", colour: "shade-1" },
  { label: "SASS", width: "50", colour: "shade-2" },
  { label: "JS", width: "50", colour: "shade-3" },
  { label: "React", width: "50", colour: "shade-2" },
  { label: "Java", width: "50", colour: "shade-2" },
  { label: "Python", width: "50", colour: "shade-2" },
  { label: "SQL", width: "50", colour: "shade-2" },
  { label: "Git", width: "50", colour: "shade-2" },
  { label: "Scrum", width: "50", colour: "shade-2" },
  { label: "Agile", width: "50", colour: "shade-2" },
];

const AboutSection = () => {
  return (
    <div className="about">
      <ContentBlock
        id="about-content"
        title={strings.about.title}
        content={content}
      />
      <div className="graph">
          {graphValues.map(({label, width,colour},i))}
        <div
          className={cn("graph-bar", `width-${width}`, `color-${colour}`)}
        ></div>
        <div className="graph-label">{label}</div>
      </div>
      {/* </div> */}
      {/* </div> */}
    </div>
  );
};

export default AboutSection;
